import { Menu } from '@mui/icons-material';
import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const TopBar = () => {
	const [media, setMedia] = useState(false);
	return (
		<div className='topBar'>
			<div className='logo-container'>
				Debug<span>DappNode</span>
			</div>
			<div className='navbar'>
				<ul>
					<li className='active'>Home</li>
					<li className='inactive'>
						<Link className='Link'>ConnectDconnect</Link>
					</li>
					<li className='inactive'>Contact</li>
					<li className='inactive'>FAQ</li>
				</ul>
			</div>
			<div
				onClick={() => setMedia(!media)}
				className='menu-icon-contaner'>
				<Menu />
			</div>
			<div
				className='sm-nav'
				style={{
					transform: media ? 'translateX(0)' : 'translateX(100%)',
				}}>
				<ul>
					<li className='active'>Home</li>
					<li className='inactive'>ConnectDconnect</li>
					<li className='inactive'>Contact</li>
					<li className='inactive'>FAQ</li>
				</ul>
			</div>
		</div>
	);
};

export default TopBar;
